import React, { useState } from 'react';

function AIVisual() {
  const [activeTab, setActiveTab] = useState('analysis');
  const [hoverPoint, setHoverPoint] = useState(null);

  // Generate sample data
  const generateTimeSeriesData = (points) => {
    return Array.from({ length: points }, (_, i) => ({
      x: i,
      y: 50 + Math.sin(i * 0.5) * 20 + Math.random() * 10
    }));
  };

  const generateScatterData = (points) => {
    return Array.from({ length: points }, () => ({
      x: Math.random() * 100,
      y: Math.random() * 100
    }));
  };

  return (
    <div className="visual-container" style={{
      position: 'relative',
      width: '600px',
      height: '600px',
      backgroundColor: '#1E293B',
      borderRadius: '24px',
      padding: '24px',
      boxShadow: '0 4px 20px rgba(0, 0, 0, 0.1)',
    }}>
      {/* Tabs */}
      <div style={{
        display: 'flex',
        gap: '20px',
        marginBottom: '24px',
      }}>
        {[
          { id: 'analysis', label: 'Data Analysis' },
          { id: 'correlation', label: 'Correlations' },
          { id: 'distribution', label: 'Distribution' }
        ].map((tab) => (
          <button
            key={tab.id}
            onClick={() => setActiveTab(tab.id)}
            style={{
              padding: '8px 16px',
              backgroundColor: activeTab === tab.id ? '#38BDF8' : 'transparent',
              border: `1px solid ${activeTab === tab.id ? '#38BDF8' : '#475569'}`,
              borderRadius: '12px',
              color: activeTab === tab.id ? '#1E293B' : '#94A3B8',
              cursor: 'pointer',
              fontSize: '14px',
              transition: 'all 0.3s ease',
            }}
          >
            {tab.label}
          </button>
        ))}
      </div>

      {/* Main Visualization Area */}
      <div style={{
        backgroundColor: '#0F172A',
        borderRadius: '16px',
        padding: '20px',
        height: '300px',
        marginBottom: '20px',
      }}>
        <svg width="100%" height="100%" style={{ overflow: 'visible' }}>
          {/* Grid Lines */}
          {Array.from({ length: 6 }).map((_, i) => (
            <React.Fragment key={i}>
              <line
                x1="0"
                y1={i * 50}
                x2="100%"
                y2={i * 50}
                stroke="#334155"
                strokeWidth="1"
                strokeDasharray="4"
              />
              <line
                x1={i * 90}
                y1="0"
                x2={i * 90}
                y2="250"
                stroke="#334155"
                strokeWidth="1"
                strokeDasharray="4"
              />
            </React.Fragment>
          ))}

          {/* Data Visualization based on active tab */}
          {activeTab === 'analysis' && (
            <path
              d={`M ${generateTimeSeriesData(12)
                .map((p, i) => `${i === 0 ? 'M' : 'L'} ${p.x * 40} ${p.y}`)
                .join(' ')}`}
              fill="none"
              stroke="#38BDF8"
              strokeWidth="2"
            />
          )}

          {activeTab === 'correlation' && 
            generateScatterData(20).map((point, i) => (
              <circle
                key={i}
                cx={point.x * 4}
                cy={point.y * 2}
                r="4"
                fill="#38BDF8"
                opacity="0.6"
              />
            ))
          }

          {activeTab === 'distribution' && (
            <path
              d={`M ${Array.from({ length: 20 }, (_, i) => ({
                x: i * 25,
                y: 125 + Math.sin(i * 0.5) * 50 * Math.exp(-(i-10) * (i-10) / 50)
              })).map((p, i) => `${i === 0 ? 'M' : 'L'} ${p.x} ${p.y}`).join(' ')}`}
              fill="none"
              stroke="#38BDF8"
              strokeWidth="2"
            />
          )}
        </svg>
      </div>

      {/* Statistics Cards */}
      <div style={{
        display: 'grid',
        gridTemplateColumns: 'repeat(3, 1fr)',
        gap: '16px',
        marginBottom: '20px',
      }}>
        {[
          { label: 'Mean', value: '67.8', unit: '' },
          { label: 'Std Dev', value: '12.4', unit: '' },
          { label: 'R²', value: '0.92', unit: '' },
        ].map((stat, i) => (
          <div
            key={i}
            style={{
              backgroundColor: '#0F172A',
              padding: '16px',
              borderRadius: '12px',
              border: '1px solid #334155',
            }}
          >
            <div style={{ color: '#94A3B8', fontSize: '12px', marginBottom: '4px' }}>
              {stat.label}
            </div>
            <div style={{ color: '#FFFFFF', fontSize: '20px' }}>
              {stat.value}{stat.unit}
            </div>
          </div>
        ))}
      </div>

      {/* Feature Importance */}
      <div style={{
        backgroundColor: '#0F172A',
        borderRadius: '16px',
        padding: '20px',
      }}>
        <div style={{ color: '#FFFFFF', marginBottom: '16px' }}>Feature Importance</div>
        {[
          { name: 'Numerical Features', value: 0.85 },
          { name: 'Categorical Encoding', value: 0.76 },
          { name: 'Time Series Patterns', value: 0.68 },
        ].map((feature, i) => (
          <div
            key={i}
            style={{
              display: 'flex',
              alignItems: 'center',
              marginBottom: '12px',
            }}
          >
            <div style={{ width: '140px', color: '#94A3B8', fontSize: '14px' }}>
              {feature.name}
            </div>
            <div style={{
              flex: 1,
              height: '8px',
              backgroundColor: '#334155',
              borderRadius: '4px',
              overflow: 'hidden',
            }}>
              <div
                style={{
                  width: `${feature.value * 100}%`,
                  height: '100%',
                  backgroundColor: '#38BDF8',
                  borderRadius: '4px',
                  animation: 'growWidth 1s ease-out',
                }}
              />
            </div>
            <div style={{ width: '50px', color: '#94A3B8', fontSize: '14px', textAlign: 'right' }}>
              {(feature.value * 100).toFixed(0)}%
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default AIVisual;
